svg.script:

	var isClicked=false;
	var prevClicked=false;
	var nextClicked=false;

	var prev=	   document.querySelector("#previous_page_button"); 
	var prev_reg=  document.querySelector("#prev_page_regular");
	var prev_vis=  document.querySelector("#prev_page_visited");
	var prev_hov=  document.querySelector("#prev_page_hovered");
	var prev_act=  document.querySelector("#prev_page_active");

	var next=	   document.querySelector("#next_page_button");
	var next_reg=  document.querySelector("#next_page_regular");
	var next_vis=  document.querySelector("#next_page_visited");
	var next_hov=  document.querySelector("#next_page_hovered");
	var next_act=  document.querySelector("#next_page_active");

	prev.addEventListener("mouseup", PREVhandleClick);
	prev.addEventListener("mouseenter", PREVhandleEnter);
	prev.addEventListener("mousedown", PREVhandleDown);
	prev.addEventListener("mouseleave", PREVhandleLeave);

	next.addEventListener("mouseup", NEXThandleClick);
	next.addEventListener("mouseenter", NEXThandleEnter);
	next.addEventListener("mousedown", NEXThandleDown);
	next.addEventListener("mouseleave", NEXThandleLeave);

	function handleClick(param){

		isClicked=!isClicked; 

		if (param==="prev"){
			prevClicked=true;
			nextClicked=false; 

			next_reg.style.opacity=1;                         	
			next_vis.style.opacity=0;                         	
			next_hov.style.opacity=0;                         	
			next_act.style.opacity=0; 
		}

		if (param==="next"){
			prevClicked=false;
			nextClicked=true;

			prev_reg.style.opacity=1;                         	
			prev_vis.style.opacity=0;                         	
			prev_hov.style.opacity=0;                         	
			prev_act.style.opacity=0; 
		} 
	}

	function PREVhandleClick(event){                       
		//console.log("this is handleClick.");
		handleClick("prev");		
		prev_reg.style.opacity=0;                         	
		prev_vis.style.opacity=1;                         	
		prev_hov.style.opacity=0;                         	
		prev_act.style.opacity=0;

		setTimeout( function (){
			window.location.href="https://www.fillmurray.com/" //https://placekitten.com/
		}, 250);
	}                                                     	

	function PREVhandleEnter(event){                       
		//console.log("this is handleEnter.");              	
		prev_reg.style.opacity=0;                         	
		prev_vis.style.opacity=0;                         	
		prev_hov.style.opacity=1;                         	
		prev_act.style.opacity=0;                         	
	}                                                     	

	function PREVhandleDown(event){                        
		//console.log("this is handleDown.");               	
		prev_reg.style.opacity=0;                         	
		prev_vis.style.opacity=0;                         	
		prev_hov.style.opacity=0;                         	
		prev_act.style.opacity=1;                         	
	}                                                     	

	function PREVhandleLeave(event){                       
 		//console.log("this is handleLeave.");    
		if (!prevClicked){
			prev_reg.style.opacity=1;
			prev_act.style.opacity=0;
		}
		else if ( prevClicked){
			prev_reg.style.opacity=0;
			prev_act.style.opacity=1;
		}		
		prev_vis.style.opacity=0;                         	
		prev_hov.style.opacity=0;  
	}                                                     	

	function NEXThandleClick(event){
		//console.log("this is handleClick."); 
		handleClick("next");
		next_reg.style.opacity=0;
		next_vis.style.opacity=1;
		next_hov.style.opacity=0;
		next_act.style.opacity=0; 

		setTimeout( function (){
			window.location.href="https://www.placecage.com/"
		}, 250);
	}

	function NEXThandleEnter(event){
		//console.log("this is handleEnter."); 
		next_reg.style.opacity=0;
		next_vis.style.opacity=0;
		next_hov.style.opacity=1;
		next_act.style.opacity=0; 
	}

	function NEXThandleDown(event){
		//console.log("this is handleDown."); 
		next_reg.style.opacity=0;
		next_vis.style.opacity=0;
		next_hov.style.opacity=0;
		next_act.style.opacity=1; 
	}

	function NEXThandleLeave(event){
		//console.log("this is handleLeave."); 

		if (!nextClicked){
			next_reg.style.opacity=1;
			next_act.style.opacity=0;
		}
		else if ( nextClicked ){
			next_reg.style.opacity=0;
			next_act.style.opacity=1;
		}	 
		next_vis.style.opacity=0;
		next_hov.style.opacity=0; 
	}

